import React from 'react'
import axios from 'axios'
//import { base_url } from '../custom/httpCustomValues'

export default class Issues extends React.Component {

  async getIssueList () {
    //const url = base_url + '/issues'
    console.log(await axios.get("localhost:8080/virtserver.swaggerhub.com/Kodstar/Issue_Tracker/1.0.0/issues"))
  }

  render () {
    return (
      <article>
        <button onClick={this.getIssueList}>get issues</button>
      </article>
    )
  }
}
